int numberOfAlternatingGroups(vector<int>& colors, int k) {
    int n = colors.size();
    if(k==1) return n;
    vector<bool> visited(n,false);
    int result = 0;
    for (int i = 0;i<n;i++)
    {
        bool check = true;
        for(int j = 1 ;j<k;j++)
        {
            int index = (i+j)%n;
            int next = (i+j+1)%n;
            if(colors[index] == colors[next]){
                check = false;
                break;
            }
        }
        if (check)
        {
            result+=1;
        }
    }
    return result;
}
int numberOfAlternatingGroups(vector<int>& colors, int k) {
    int n = colors.size();
    int count = 0;
    int l =0 ;  
    int limit = n+k-1;
    while (l<limit)
    {
        /* code */
        int r = l+1;
        while (r<limit && colors[(r-1)%n]!=colors[r%n]) 
        {
            /* code */
            r++;
        }
        if(r-l>=k)
        {
            count+=(r-l)-k+1;
        }
        l = r;
        
    }
    return count;
    
}
